import React from 'react'
import { View, Image } from 'react-native'
import CustomInput from '../../components/CustomInput'

export default function SingInScreen() {
  return (
      <View>
        <Image source={UserImg} style={styles.userImg} />
        <CustomInput/>
    </View>
  )
}
